window.bookSummaryJSON = "<p><b>Love bound us together...but fate has other plans.</b></p> <p>Just when a happily-ever-after with my Seelie men was within reach, the Heart of the Mists tied me to one of the foreboding winter arch-lords. I can't escape the connection between us. The enemy can speak from right within my soul.</p> <p>I'm not willing to give up on my happiness that easily, but I can't let the realms descend into all-out war. I'll brave the uncertainties of the winter lands if that's what it takes to protect the men I love.</p> <p>My chilly Unseelie arch-lord isn't quite what I expected, though. As the lines between ally and enemy start to blur, can I stop the clash of winter and summer before even more blood is shed?</p> <p><b><i>Royal Mate</i></b><b> is the fourth in Bound to the Fae, a new paranormal-romance series featuring possessive wolf-shifters, dangerous fae politics, and a wounded heroine finding her strength. Grab it now, and get swept away in the fantasy!</b></p>"; 
